import React from 'react';

const Oops = () => (
  <div className="card">
    <div className="card-header">
      <div className="card-title h3 text-gray">
        Oops! Looks like you're offline and this page is not cached either. Try again when you're online.
      </div>
    </div>
  </div>
);

export default Oops;
